module hardcopyiv_hssi_pma_c_divby2q (
   clk, clk0, clk90, clk180, clk270, clkb, rst_n, vcce_la, vssexqyx );

   input   clk;
   input   clkb;
   input   rst_n;
   input   vcce_la;
   input   vssexqyx;

   output  clk0;
   output  clk90;
   output  clk180;
   output  clk270;

   reg     clk0, clk90, clk180, clk270, clk0_init;

   initial begin
     clk0_init = 1'b0;
     clk0      = 1'b1;
     clk90     = 1'b1;
     clk180    = 1'b1;
     clk270    = 1'b1;
   end

   always @ ( posedge clk or negedge rst_n )
     if ( rst_n == 1'b0 ) begin
        clk0_init <= 1'b0;
        clk0      <= 1'b1;
        clk180    <= 1'b1;
     end
     else begin 
       clk0_init <= 1'b1;
       clk0      <= ~clk0;
       clk180    <=  clk0;
     end

   always @ ( posedge clkb or negedge rst_n )
     if ( rst_n == 1'b0 ) begin
       clk90  <= 1'b1;
       clk270 <= 1'b1;
     end
     else begin
       if ( clk0_init == 1'b1 ) begin
         clk90  <= ~clk90;
         clk270 <=  clk90;
       end
     end

endmodule // hardcopyiv_hssi_pma_c_divby2q

