    input [8*`HARDCOPYIV_HSSI_CD_WORD_LENGTH:1] given_string;

    reg [8*`HARDCOPYIV_HSSI_CD_WORD_LENGTH:1] return_string;
    reg [8*`HARDCOPYIV_HSSI_CD_WORD_LENGTH:1] reg_string;
    reg [8:1] tmp;
    reg [8:1] conv_char;
    integer byte_count;
    begin
