defparam pcie_sw_1.extra_latency = 0;

always @(posedge reset or pcie_div2_clk1)
begin
    if (reset == 1'b1)
        pcie_div2_clk3 <= 1'b0;
    else
    pcie_div2_clk3 <= ~pcie_div2_clk1;
end

always @(busy or reset)
begin
    if (reset  ===  1'b1)
        locked_real <= 1'b0;
    else if (busy == `S4_HSSI_PLL_INACTIVE || adjust_without_lol == 1'b1) 
        locked_real <= 1'b1;
    else
        locked_real <= 1'b0;
