    init_rpre_em_1t_no_pcie	= preemp_tap_1;
    
    // TX PMA control register 3
    init_rpre_em_pt	= preemp_pretap;
    init_rpre_em_2t	= preemp_tap_2;
    init_rpre_em_1t_c	= preemp_tap_1_c;
    
