// runningdisp - 4;  
    always @(rd_out_rxd[15] or rd_out_rxd[31] or rd_out_rxd[47] or rd_out_rxd[63])
    begin
        if (cram_rpma_doublewidth_rx == 1'b0 && cram_rdwidth_rx == 1'b1)
        begin
