function [8*`HARDCOPYIV_HSSI_CMU_ALPHA_TOLOWER_WORD_LENGTH:1] alpha_tolower;
input [8*`HARDCOPYIV_HSSI_CMU_ALPHA_TOLOWER_WORD_LENGTH:1] input_string;

reg [8*`HARDCOPYIV_HSSI_CMU_ALPHA_TOLOWER_WORD_LENGTH:1] return_string;
reg [8*`HARDCOPYIV_HSSI_CMU_ALPHA_TOLOWER_WORD_LENGTH:1] reg_string;
reg [8:1] tmp;
reg [8:1] conv_char;
integer byte_count;
begin
reg_string = input_string;
for (byte_count = `HARDCOPYIV_HSSI_CMU_ALPHA_TOLOWER_WORD_LENGTH; byte_count >= 1; byte_count = byte_count - 1)
begin
    tmp = reg_string[8*`HARDCOPYIV_HSSI_CMU_ALPHA_TOLOWER_WORD_LENGTH:(8*(`HARDCOPYIV_HSSI_CMU_ALPHA_TOLOWER_WORD_LENGTH-1)+1)];
    reg_string = reg_string << 8;
    if ((tmp >= 65) && (tmp <= 90)) // ASCII number of 'A' is 65, 'Z' is 90
    begin
	conv_char = tmp + 32; // 32 is the difference in the position of 'A' and 'a' in the ASCII char set
	return_string = {return_string, conv_char};
    end
    else
	return_string = {return_string, tmp};
end

alpha_tolower = return_string;
end
endfunction

// function int2bin
function [31:0] int2bin;
    input input_value;
    integer input_value;
    integer i;     
    begin
    for (i = 0; i <= 31; i = i + 1)
    begin
        if (input_value % 2 == 0) 
    	    int2bin[i] = 1'b0;	
        else
    	   int2bin[i] = 1'b1;	
    	    		
    	input_value = input_value / 2;
    end
    end
endfunction 
// end function

